import React from 'react';
import styled from 'styled-components';
import Logo from '../Assets/logo.png';

export const Entrance = () => {
  return (
    <Background>
        <img src={Logo} alt="로고" width="5%" />
        <LoadingText>MOEUM</LoadingText>
    </Background>
  );
};

export default Entrance;

export const Background = styled.div`
  position: absolute;
  width: 100vw;
  height: 100vh;
  top: 0;
  left: 0;
  background: #FFFCF4;
  z-index: 999;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;

export const EntranceText = styled.div`
  font: 1rem 'Pretendard';
  text-align: center;
`;
